    [],nt"revision_timestamp": "2013-03-15T20:55:08.897048",nt"name": "ctd-database-cascadia-tsunami-deposit-database",nt"isopen":
    false,nt"url": null,nt"notes": "The Cascadia Tsunami Deposit Database contains
    data on the location and sedimentological properties of tsunami deposits found along
    the Cascadia margin. Data have been compiled from 52 studies, documenting 59 sites
    from northern California to Vancouver Island, British Columbia that contain known
    or potential tsunami deposits. Bibliographical references are provided for all sites
    included in the database. Cascadia tsunami deposits are usually seen as anomalous
    sand layers in coastal marsh or lake sediments. The studies cited in the database
    use numerous criteria based on sedimentary characteristics to distinguish tsunami
    deposits from sand layers deposited by other processes, such as river flooding and
    storm surges. Several studies cited in the database contain evidence for more than
    one tsunami at a site. Data categories include age, thickness, layering, grainsize,
    and other sedimentological characteristics of Cascadia tsunami deposits. The database
    documents the variability observed in tsunami deposits found along the Cascadia
    margin.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
